}

.native-ad__content--brand-name {
	color: #737373;
	text-decoration: none;
}

.native-ad__content--brand-type {
	display: inline-block;
}

.native-ad__content--title {
	color: #333;
	font: 700 18px/26px 'Merriweather', serif;
	letter-spacing: 0;
	margin-bottom: 16px;
}

.native-ad__content--title:hover {
	text-decoration: underline;
}

.native-ad__content--author {
	align-items: center;
	color: #333;
	display: flex;
	font: 12px/2 'Work Sans', sans-serif;
	letter-spacing: -0.1px;
	text-decoration: none;
}

.native-ad__content--author-byline,
.native-ad__content--author-name {
	padding-right: 4px;
}

.native-ad__content--author-name {
	font-weight: 700;
  white-space: nowrap;
}

.native-ad__content--author-type {
	color: #737373;
	font: 400 10px/1.2 'Work Sans', sans-serif;
}

.native-ad__ghost {
	background-color: #EEEEEE;
}

#ghost-2,
#ghost-6 {
	height: 14px;
	margin-bottom: 8px;
	width: 75%;
}

#ghost-3,
#ghost-4,
#ghost-5 {
	height: 20px;
	margin-bottom: 6px;
}

#ghost-3 {
	width: 75%;
}

#ghost-4 {
	width: 90%;
}

#ghost-5 {
	margin-bottom: 8px;
	width: 80%;
}

.container__mobile {
  padding: 16px 16px 30px;
}

.container__mobile > .native-ad > .native-ad__image {
  margin-bottom: 16px;
}

.container__mobile > .native-ad > .native-ad__content {
		padding-left: 0px;
}

.container__mobile > .native-ad > .native-ad__content > .native-ad__content--brand {
  margin-bottom: 9px;
}

.container__mobile > .native-ad > .native-ad__content > .native-ad__content--title {
  font-size: 16px;
  line-height: 24px;
}
